import React from "react";
import '../assets/styles/Main.scss';
import image1 from '../assets/images/1.png';
import image2 from '../assets/images/2.png';
import image3 from '../assets/images/3.png';
import image4 from '../assets/images/4.png';
import image5 from '../assets/images/5.png';

function Main() {
  return (
    <div className="hero-section">
      {/* Watercolor Background Elements */}
      <div className="watercolor-bg watercolor-1"></div>
      <div className="watercolor-bg watercolor-2"></div>
      <div className="watercolor-bg watercolor-3"></div>

      {/* Organic Shape Accents */}
      <div className="organic-shape shape-1"></div>
      <div className="organic-shape shape-2"></div>

      <div className="hero-content-container">
        <div className="hero-text-content">
          <p className="greeting-text">Hello, I'm</p>
          <h1 className="hero-name">Shailee Patel</h1>
          <div className="hero-tags">
            <span className="tag">Software Engineer</span>
            <span className="tag-separator">•</span>
            <span className="tag">Traveler</span>
            <span className="tag-separator">•</span>
            <span className="tag">Photographer</span>
            <span className="tag-separator">•</span>
            <span className="tag">Hiker</span>
          </div>
          <p className="hero-subtitle">
            Crafting elegant code by day, capturing mountain sunrises by dawn. 
            I bring the same passion for organization and creativity to every project.
          </p>
          <div className="hero-cta-group">
            <button className="cta-button-primary" onClick={() => {
              const careerSection = document.getElementById('career');
              if (careerSection) {
                careerSection.scrollIntoView({ behavior: 'smooth' });
              }
            }}>
              View My Work
            </button>
            <button className="cta-button-secondary" onClick={() => {
              const contactSection = document.getElementById('contact');
              if (contactSection) {
                contactSection.scrollIntoView({ behavior: 'smooth' });
              }
            }}>
              Get In Touch
            </button>
          </div>
        </div>

        {/* Photo Collage Section */}
        <div className="hero-visual-section">
          <div className="photo-frame frame-1">
            <div className="photo-placeholder">
              <span className="photo-label">Travel</span>
            </div>
          </div>
          <div className="photo-frame frame-2">
            <div className="photo-placeholder">
              <span className="photo-label">Photography</span>
            </div>
          </div>
          <div className="photo-frame frame-3">
            <div className="photo-placeholder">
              <span className="photo-label">Hiking</span>
            </div>
          </div>
        </div>
      </div>

      {/* Decorative Elements */}
      <div className="brush-stroke stroke-1"></div>
      <div className="brush-stroke stroke-2"></div>
    </div>
  );
}

export default Main;
